import React from "react";
import vg from "../assets/profileImage.jpg";

const Home = () => {
  return (
    <>
      <div>
        <div className="bio">
          <h3>Hi There! My Name Is</h3>
          <h1>Prakruthi Manjunatha</h1>
          <p>
            Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quae
            impedit pariatur quas magni excepturi quia consequuntur, similique
            voluptatum molestiae veniam sapiente nemo deserunt reprehenderit
            soluta aperiam saepe, expedita dolorem maxime.
          </p>
        </div>
        <div className="img">
          <img src={vg} alt="" />
        </div>
      </div>
    </>
  );
};

export default Home;
